import React from 'react';
import '../css/HeaderIn.css';

class Friends extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <div className="counter">7</div>
                <i className="fas fa-user-friends" />
            </div>
        );
    }
}

export default Friends;
